import styled from "styled-components";

export const CarrinhoStyle = styled.div`
color: white;
font-size:30px;
background-color: black;
height:70vh;
display: grid;
grid-template-columns:1fr 1fr;
grid-row: 1fr;
padding: 5%;
column-gap:0px;
justify-items: center;
border: 1px solid grey;
text-align: center;
padding-top:10px
`
